import React from "react";
import { useSelector } from "react-redux";
import { /*NavLink,*/ useHistory } from "react-router-dom";

export default function PageNotFound() {
  const language = useSelector((state) => state.language);

    const history = useHistory();

    const handleOnClick = (event) => {
        event.preventDefault();
        history.push("/countries");
    }

  return (
    <div>
      <div className="page-not-found-container">
        <h1>{language ? "País no encontrado" : "Country not found"}</h1>
      </div>
      <div className="page-not-found-back-container">
        {/* <NavLink to="/countries" className="back-page-not-found"> */}
          <button className="page-not-found-btn" onClick={(event) => handleOnClick(event)}>
            {language ? "⬅ Volver" : "⬅ Go Back"}
          </button>
        {/* </NavLink> */}
      </div>
    </div>
  );
}
